INSERT INTO `drugindex` (`id_drugindex`, `drug`, `nick`, `comment`, `ischild`, `class`, `minagemonth`) VALUES
(1, 'abacavir', 'ABC', 'ABACAVIR.<3 months : Not Recommended. Above 3 months of age:Recommended dose 8 mg/kg bodyweight TWICE daily.Adult dose: 300mg bid OR 600mg qd.Dose reduction in mild hepatic impairement. Stop and discontinue ABC in case of hypersensitivity.Not to be rx with TDF. does not interfere with cytochrome P450 pathway. ', 1, 'nr', 3),
(2, 'didanosine', 'ddI', 'DIDANOSINE.<8 months: Rec dose 100 mg/sq m .Age >8 months:Rec dose 120 mg/sq m BSA.Adult dose: wt >=60 kg 200 mg TWICE daily. wt <60 kg Rec dose:125 mg twice daily . Dose of delayed release capsule : 400 mg once daily if wt>=60kg, 250 mg once daily if wt,60kg.Decrease dose with TDF to 250mg or 200mg EC once daily .Taken in empty stomach.take atleast two tablets of appropiate strength.caution in renal impairement.', 1, 'nr', 0),
(3, 'emtricitabine', 'FTC', 'EMTRICITABINE(FTC).age> 3months rec dose:6 mg /kg wt ONCE daily (Max.200mg/day).can be taken without regard to food.Dont combine with lamivudine.', 1, 'nr', 3),
(4, 'lamivudine', '3TC', 'LAMIVUDINE(3TC).rec dose age<1 month: 2 mg/kg wt twice daily.Others 4 mg/kg wt( max 150 mg) TWICE daily.In adults may be administered 300mg single dose. taken without regard to food. Donot combine with emtricitabine(FTC).', 1, 'nr', 0),
(5, 'stavudine', 'd4T', 'STAVUDINE.0-13 days recdose: half mg/kg. above age 2 weeks recdose:1mg/kg. 30kg--60kg dose:30mg .> 60 kg dose:40 mg. ALL administered TWICE daily. Donot combine with zidovudine /didanosine.caution in renal impairement. ', 1, 'nr', 0),
(6, 'tenofovir', 'TDF', 'TENOFOVIR(TDF).NOT recommended for use <18 yrs .Adult dose 300mg once a day.reduce dose of didanosine when used with TDF. only ritonavir boosted atazanavir be used with TDF.donot combine with ABC.', 0, 'nr', 216),
(7, 'zalcitabine', 'ddC', 'Discontinued', 0, 'nr', 156),
(8, 'zidovudine', 'AZT', 'ZIDOVUDINE(AZT/ZDV).Age less than 6 weeks:2mg/kg every 6 hours.pediatric dose:160 mg/sq m thrice daily OR 180-240mg/sq m TWICE daily. Adult dose: 200 mg tid OR 300 mg bid.Sould not combine with stavudine.caution in renal impairement.potential bonemarrrow suppresion.', 1, 'nr', 0),
(9, 'nevirapine', 'NVP', 'NEVIRAPINE.Induction phase 14 days:ONCE daily followed by regular Twice daily dosing. Pediatric dose:120--200mg/sq m  BSA.Age < 8yrs dose:7mg/kg wt , age> 8yr dose:4mg/kg wt . MAX dose 200mg bid.caution in females with CD4 >250,malesCD4>400. if discontinued for more than 7 days,induction phase is required.', 1, 'nn', 0),
(10, 'efavirenz', 'EFV', 'EFAVIRENZ.Not recommended  <3 years or <10kg.dose 10-15kg :200mg.Dose 15-20kg : 250mg. Rec Dose 20-25 kg :300mg. rec Dose 25-32.5 kg : 350 mg. dose 32.5-40 kg :400mg. Dose wt >= 40kg :  600mg. administered once daily. prefer taken in empty stomach at bedtime.Contra indicated in pregnancy.Concominant PI require Boosting with RTV.', 1, 'nn', 36),
(11, 'delavirdine', 'DLV', 'DELAVIRDINE.not for pediatric use < 16 yrs. Dose: 400 mg THRICE daily.', 0, 'nn', 192),
(12, 'atazanavir', 'ATV', 'Not recommended < 16 yrs of age.Dose in treatment naive:400 mg once daily.Rec Dose in treatment experienced : 300 mg Boosted with RITONAVIR 100 mg administered once daily.', 0, 'pi', 192),
(13, 'darunavir', 'DRV', 'Rec Dose > 18 yrs of age : 600 mg Boosted with RITONAVIR 100 mg administered twice daily.', 0, 'pi', 216),
(14, 'fosamprenavir', 'FPV', 'Treatment naive adolescent and adults. 1400 mg twice daily or .1400 mg +RITONAVIR 200 mg once daily or. 700 mg FPV + 100 mg  RITONAVIR  twice daily. In Treatment experienced adolescent and adults:700 mg FPV + 100 mg RTV, twice daily.', 0, 'pi', 192),
(15, 'indinavir', 'IDV', 'Adolescent/adult Dose: 800 mg Thrice daily.Adults(in combinaton with ritonavir) 800mg + 200 mg RTV Twice daily.In combinaton with Efavirenz ( in adults) 100 mg Thrice daily. In combinaton with Delavirdine ( in adults) 600 mg Thrice daily. reduce dose in mild to moderate hepatic impairement.', 0, 'pi', 192),
(16, 'lopinavir/ritonavir', 'LPV', 'Coformulation of lopinavir and ritonavir.', 1, 'pi', 6),
(17, 'nelfinavir', 'NFV', '', 1, 'pi', 24),
(18, 'ritonavir', 'RTV', '', 0, 'pi', 1),
(19, 'saquinavir', 'SQV', '', 0, 'pi', 192),
(20, 'tipranavir', 'TPV', '', 0, 'pi', 216),
(21, 'amprenavir', 'APV', '', 1, 'pi', 48),
(31, 'abacavir/lamivudine/zidovudine', '', 'FDC of abacavir,lamivudine,zidovudine.administered twice daily.not to be used in hepatic impairement.contraindicated in patients with cr clearance < 50ml/min. ', 1, 'fd', 3),
(32, 'abacavir/lamivudine', '', 'FDC of abacavir and lamivudine. once daily dosing.', 1, 'fd', 3),
(33, 'tenofovir/emtricitabine', '', 'FDC of tenofovir and emtricitabine . Once daily dosing.', 0, 'fd', 216),
(34, 'tenofovir/emtricitabine/efavirenz', '', 'FDC of tenofovir,emtricitabine and efavirenz dosed once daily.Recommended to be administered in empty stomach. caution in renal impairement.   ', 0, 'fd', 216),
