('p00', 'pulse,bp,respiration,tempature', 'Pulse,BP,Respiration,Tempature'),
('s10', 'f_cholesterol,f_hdl_choles,f_ldl_choles', 'Cholesterol,HDL Cholestero,LDL Cholestero'),
('s11', 'f_bilirubin,f_sgpt,f_sgot,tbxgeneralimp', 'Bilirubin,SGPT,SGOT,Impression'),
('s32', 'cd4_count,cd4_percent,viral_load', 'CD4 Count,CD4 Percent, Viral Load'),
('s36', 'haemoglobin,mcv,mchc,mch', 'Haemoglobin,MCV,MCHC,MCH');
INSERT INTO `genotype` (`id_mutation`, `mutation`, `mutation_type`, `comment`) VALUES
(1, 'D30N', 'Major PI', 'D30N causes intermediate resistance to NFV.'),
(2, 'V32I', 'Major PI', 'V32I is a substrate cleft mutation that reduces susceptibility to IDV, RTV, FPV, LPV, TPV, and DRV.'),
(3, 'L33F', 'Major PI', 'L33F are selected by FPV, DRV, LPV, ATV, and TPV, and slightly contribute resistance to these drugs.'),
(4, 'M46I', 'Major PI', 'M46I/L decreases susceptibility to IDV, NFV, FPV, LPV, ATV, TPV, and possibly SQV and DRV when present with other mutations.'),
(5, 'M46L', 'Major PI', 'M46I/L decreases susceptibility to IDV, NFV, FPV, LPV, ATV, TPV, and possibly SQV and DRV when present with other mutations.'),
(6, 'I47V', 'Major PI', 'I47V decrease susceptibility to FPV, ATV, IDV, LPV, TPV, and DRV.'),
(7, 'I47A', 'Major PI', 'I47A usually occurs in combination with V32I and in this setting causes high-level LPV and FPV resistance and probably intermediate DRV resistance.'),
(8, 'G48V', 'Major PI', 'G48V causes high-level SQV resistance, intermediate ATV and NFV resistance, and low-level IDV and LPV resistance.'),
(9, 'G48M', 'Major PI', 'G48M causes high-level SQV resistance and intermediate resistance to NFV, ATV, IDV, and NFV.'),
(10, 'I50L', 'Major PI', 'I50L causes intermediate-to-high level resistance to ATV and hypersusceptibility to the remaining PIs.'),
(11, 'I50V', 'Major PI', 'I50V causes intermediate-to-high-level resistance to FPV, intermediate resistance to LPV and DRV, and increased susceptibility to TPV.'),
(12, 'I54A', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(13, 'I54L', 'Major PI', 'I54L occurs in patients receiving FPV, LPV, and DRV and reduces susceptibility to these drugs and to NFV and possibly ATV. It is associated with increased susceptibility to TPV.'),
(14, 'I54M', 'Major PI', 'I54M occurs in patients receiving FPV, LPV, and DRV and reduces susceptibility to these drugs and to ATV and NFV.'),
(15, 'I54S', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(16, 'I54T', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(17, 'I54V', 'Major PI', 'I54V contributes resistance to each of the PIs except possibly DRV when present with other mutations.'),
(18, 'L76V', 'Major PI', 'L76V reduces susceptibility to FPV, IDV, LPV, and DRV and increases susceptibility to SQV and ATV.'),
(20, 'V82A', 'Major PI', 'V82A reduces susceptibility to IDV and LPV. With other mutations it is associated with reduced susceptibility to NFV, ATV, SQV, FPV, and TPV.'),
(21, 'V82F', 'Major PI', 'V82F reduces susceptibility to IDV, LPV, FPV, and DRV. With other mutations it is associated with reduced susceptibility to NFV, ATV, SQV, and TPV.'),
(22, 'V82L', 'Major PI', 'V82L is a rare TPV-selected mutation. Its effect on other PIs has not been characterized.'),
(23, 'V82S', 'Major PI', 'V82S probably has a similar effect to V82T which reduces susceptibility to IDV, LPV, and TPV and with other mutations is associated with reduced susceptibility to NFV, ATV, FPV, and SQV.'),
(24, 'V82T', 'Major PI', 'V82T reduces susceptibility to IDV, LPV, and TPV. With other mutations it is associated with reduced susceptibility to NFV, ATV, FPV, and SQV.'),
(25, 'I84V', 'Major PI', 'I84V causes intermediate/high-level resistance to ATV, FPV, IDV, NFV, SQV, and TPV, and low-level intermediate resistance to LPV and DRV.'),
(26, 'N88S', 'Major PI', 'N88S causes high-level resistance to NFV and ATV and low-level resistance to IDV; it increases susceptibility to FPV.'),
(27, 'N88T', 'Major PI', 'N88T has not been studied but is likely to be similar to N88S which causes high-level resistance to NFV and ATV, low-level resistance to IDV, and increased susceptibility to FPV.'),
(28, 'N88G', 'Major PI', 'N88G has not been studied but is likely to be similar to N88S which causes high-level resistance to NFV and ATV, low-level resistance to IDV, and increased susceptibility to FPV.'),
(29, 'L90M', 'Major PI', 'L90M causes resistance to NFV, SQV, ATV, and IDV. When present with other mutations it also compromises the activity of FPV, LPV, and TPV. Its effect on DRV is not known.'),
(31, 'L10F', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(32, 'L10I', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(33, 'L10V', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(34, 'V11I', 'Minor PI', 'V11I is a nonpolymorphic accessory mutation weakly associated with PI therapy. It is one of the 11 mutations associated with decreased response to DRV in the POWER trials.'),
(37, 'K43T', 'Minor PI', 'K43T is a nonpolymorphic mutation that is significantly more common in viruses from PI-treated compared with untreated persons. It was weakly associated with a decreased virological response to TPV in the RESIST trials.'),
(38, 'F53L', 'Minor PI', 'F53L occurs only in isolates from treated patients nearly always in combinations with other PI-resistance mutations. It is associated with decreased susceptibility to IDV, LPV, and SQV and possibly other PIs. F53Y is a rare treatment-associated variant.'),
(39, 'Q58E', 'Minor PI', 'Q58E is a nonpolymorphic mutation that occurs more commonly in treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(42, 'A71T', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(45, 'G73C', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(46, 'G73S', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(47, 'G73T', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(49, 'N83D', 'Minor PI', 'N83D is a nonpolymorphic mutation that occurs more commonly in heavily treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(50, 'L89V', 'Minor PI', 'L89V is an uncommon nonpolymorphic PI-selected accessory mutation. It is one of the 11 mutations associated with decreased response to DRV in the POWER trials.'),
(63, 'G36V', 'FI', ''),
(64, 'I37V', 'FI', ''),
(65, 'V38A', 'FI', ''),
(66, 'V38E', 'FI', ''),
(67, 'V38M', 'FI', ''),
(69, 'Q39R', 'FI', ''),
(70, 'Q40H', 'FI', ''),
(72, 'N43D', 'FI', ''),
(73, 'N43K', 'FI', ''),
(75, 'L44M', 'FI', ''),
(76, 'L45M', 'FI', ''),
(90, 'H51Y', 'II', ''),
(95, 'E138A', 'II', ''),
(97, 'G140A', 'II', ''),
(99, 'S147G', 'II', ''),
(100, 'Q148H', 'II', ''),
(102, 'Q148K', 'II', ''),
(104, 'N155H', 'II', ''),
(105, 'E157Q', 'II', ''),
(106, 'G163R', 'II', ''),
(107, 'R263K', 'II', ''),
(108, 'T97A', 'II', ''),
(150, 'E138K', 'NNRTI', 'E138K is selected in vitro by ETV and reduces its susceptibility by about 5-fold. \r\nE138K reduces susceptibility to other NNRTIs by about 2-5 fold.'),
(152, 'L100I', 'NNRTI', 'L100I causes intermediate resistance to NVP, DLV, and EFV, and low-resistance to ETV. \r\nIt occurs nearly always in combination with K103N. \r\nL100I increases susceptibility to AZT and TDF.'),
(153, 'K101E', 'NNRTI', 'K101E is associated with intermediate resistance to NVP and DLV and low-level resistance to EFV and ETV.'),
(155, 'K101P', 'NNRTI', 'K101P usually occurs with K103N and in this setting causes high-level resistance to NVP, DLV, and EFV and low-intermediate resistance to ETV.'),
(156, 'K101QR', 'NNRTI', 'K101Q/R occasionally occur in untreated persons and do not decrease NNRTI susceptibility.'),
(157, 'K103H', 'NNRTI', 'K103T/H are rare mutations that appear to be associated with high-level resistance to NVP, DLV, and EFV.'),
(158, 'K103N', 'NNRTI', 'K103N causes high-level resistance to NVP, DLV, and EFV. \r\nBy itself it has no effect on ETV susceptibility.\r\nK103N occurs in >50% of patients developing virologic failure while receiving EFV and reduces EFV susceptibility ~25-fold .\r\nThe development of K103N is often accompanied by mutations at position 188 or 190 or followed by one of the accessory mutations .\r\nK103N reduces NVP susceptibility >=50-fold with the precise reduction in susceptibility depending on other synergistically acting mutations.\r\n'),
(159, 'K103R', 'NNRTI', 'K103R is a polymorphism that is not selected by NNRTIs  .\r\nK103R occurs in about 1%-2% of untreated persons and by itself has no effect on NNRTI susceptibility.\r\nHowever, the combination of K103R + V179D, reduces  resistance to NVP, DLV, and EFV.\r\n103R reduces NVP susceptibility x15 fold.'),
(160, 'K103S', 'NNRTI', 'K103S causes high-level resistance to NVP and intermediate resistance to DLV and EFV.\r\n'),
(161, 'K103T', 'NNRTI', 'K103S/T/H are rare mutations that reduce EFV susceptibility .'),
(162, 'V106A', 'NNRTI', 'V106A causes high-level NVP resistance, intermediate DLV resistance, and low-level EFV and ETV resistance.\r\nV106A reduces NVP susceptibility >50-fold. \r\nV106A is associated with about 10-fold decreases in EFV susceptibility.\r\n\r\n '),
(166, 'V179D', 'NNRTI', 'V179D/E cause low-level reductions in susceptibility to each of the NNRTIs. \r\nV179D occurs in about 1% of untreated persons. \r\nThe combination of K103R + V179D reduces the susceptibility of NVP, DLV, and EFV by about 15-fold.\r\nThe combination''s effect on ETV is not known.'),
(170, 'Y181I', 'NNRTI', 'Y181I/V  are rare mutations that reduce NVP susceptibility >100-fold.\r\n Y181C/I/V have consistently been found to produce the greatest (>10 to >20-fold) reductions in ETV susceptibility .\r\nEFV is often ineffective at treating such patients because most patients failing a previous NNRTI-containing regimen harbor virus subpopulations with multiple different NNRTI-resistance mutations.'),
(172, 'Y188C', 'NNRTI', 'Y188C causes high-level resistance to NVP and low-level resistance to EFV and DLV; its effect on ETV is not known.\r\nY188C reduces NVP susceptibility x15-fold.\r\n Y188C is associated with about 10-fold decreases in EFV susceptibility .'),
(174, 'Y188L', 'NNRTI', 'Y188L causes high-level resistance to NVP and EFV and low-level resistance to ETV and DLV.\r\nY188L reduces NVP susceptibility x50 fold.\r\n Y188L is associated with >100-fold decreases in EFV susceptibility .'),
(176, 'G190CTV', 'NNRTI', 'G190C/T/V are rare mutations that cause high-level resistance to NVP and EFV and variable resistance to DLV. Their effect on ETV is not known.'),
(177, 'G190EQ', 'NNRTI', 'G190E/Q cause high-level resistance to NVP and EFV and intermediate resistance to DLV.\r\n G190E + Y181C is associated with >100-fold decreased ETV susceptibility.\r\n190 E/Q/C/T are rare mutations that decrease NVP susceptibility by over x100 fold. '),
(178, 'G190S', 'NNRTI', 'G190S causes high-level resistance to NVP and EFV and low-level / intermediate resistance to ETV.\r\n190S reduces EFV susceptibility by over x100 fold.\r\n190S reduces NVP susceptibility by over x50 fold.\r\n190S increases DLV susceptibility.'),
(179, 'P225H', 'NNRTI', 'P225H increases EFV resistance when present in combination with K103N.'),
(180, 'P236L', 'NNRTI', '	P236L causes high-level DLV resistance.'),
(181, 'F227C', 'NNRTI', 'F227C is a rare mutation which has been associated with inconsistently reported levels of resistance to each of the NNRTIs particularly ETV.'),
(183, 'M230L', 'NNRTI', 'M230L causes intermediate-to-high-level resistance to each of the NNRTIs. \r\nIt has been selected in vitro by ETV and reduces ETV susceptibility by about 10-fold.'),
(184, 'K238T', 'NNRTI', 'K238N/T are NNRTI-selected mutations that usually occur in combination with other NNRTI-resistance mutations and which appear to confer intermediate levels of resistance to NVP and possibly DLV and EFV.'),
(185, 'K238N', 'NNRTI', 'K238N/T are NNRTI-selected mutations that usually occur in combination with other NNRTI-resistance mutations and which appear to confer intermediate levels of resistance to NVP and possibly DLV and EFV.'),
(186, 'Y318F', 'NNRTI', 'Y318F is a rare mutation that causes high-level DLV resistance and low/intermediate NVP resistance. It usually occurs with other NNRTI-associated mutations.'),
(201, 'M41L', 'TAM', 'M41L is a Type1 TAM.\r\nM41L usually occurs with T215Y. Together these mutations confer intermediate-to-high level resistance to AZT and d4T and a lower level of resistance to ddI, ABC, and TDF.\r\nCombinations of 4 or more TAMs reduced ZDV susceptibility several hundred fold.\r\nThe effect of TAMs on in vitro susceptibility is subtle with two or more TAMs (generally M41L + T215Y) required before reductions (>1.5-fold) in d4T susceptibility are detected. \r\n TAMs are generally considered to be as determinental to the virological success of d4T-containing regimens as they are for ZDV-containing regimens .\r\n41L + L210W + T215Y reduce TDF susceptibility x4 fold and is associated with a marked decrease in TDF activity . \r\nViruses containing only one or two of these three mutations retain partial TDF susceptibility.\r\n TAMs have a subtle effect on in vitro ddI susceptibility, with three or more TAMs (particularly M41L, L210W, and T215Y) required to reduce susceptibility by x1.5 fold.\r\n However, despite the minimal effect on in vitro susceptibility, the presence of M41L, L210W, and T215Y is associated with a greatly reduced virological response to ddI intensification.\r\n  M41L + T215F/Y ? L210W reduces ABC susceptibility 2-3 fold. \r\nThe presence of four or more TAMs is usually associated with x5-fold reduced susceptibility to 3TC. \r\nThe clinical significance of this reduction is not known. '),
(203, 'K70R', 'TAM', 'K70R is a Type2 TAM.\r\nK70R causes low-level AZT, d4T, and possibly TDF resistance and appears to have little if any effect on the other NRTIs.\r\nK70R reduced ZDV susceptibility x4-fold .\r\n\r\n'),
(204, 'L210W', 'TAM', 'L210W is a Type1 TAM.\r\nCombinations of 4 or more TAMs reduced ZDV susceptibility several hundred fold.\r\nThe combination of M41L, L210W, and T215Y reduces TDF susceptibility x4 fold and is associated with a marked decrease in TDF activity . \r\nViruses containing only one or two of these three mutations retain partial TDF susceptibility . \r\nThe effect of TAMs on in vitro susceptibility is subtle with two or more TAMs required before reductions (>1.5-fold) in d4T susceptibility are detected. \r\nTAMs are generally considered to be determinental to the virological success of d4T-containing regimens.\r\nThe presence of four or more TAMs is usually associated with x5-fold reduced susceptibility to 3TC. \r\nThe clinical significance of this reduction is not known. M41L, L210W, and T215Y appear to have the greatest effect on 3TC susceptibility.\r\n  TAMs have a subtle effect on in vitro ddI susceptibility, with three or more TAMs (particularly M41L, L210W, and T215Y) required to reduce susceptibility by x1.5 fold.\r\n However, despite the minimal effect on in vitro susceptibility, the presence of M41L, L210W, and T215Y is associated with a greatly decreased virological response to ddI intensification\r\n 41L + 215F/Y ? L210W reduces ABC susceptibility 2-3 fold. \r\nThe addition of M184V and other TAMs to this set of mutations reduces ABC susceptibility 6-8 fold and decreases the virologic response to ABC intensification and salvage therapy .'),
(205, 'T215F', 'TAM', 'T215F  is a Type2 TAM.\r\n'),
(207, 'K219Q', 'TAM', 'Type2 TAM'),
(208, 'K219E', 'TAM', 'Type2 TAM'),
(210, 'E44A', 'NAM', 'E44A/D occur in patients receiving multiple NRTIs.\r\nE44A/D and V118I are accessory mutations that usually occur with multiple TAMs.\r\nIn this setting they contribute some degree of resistance to each of the NRTIs including 3TC and FTC .\r\nE44D causes low-level resistance to 3TC and probably to each of the other NRTIs when present with V118I or one or more TAMs.'),
(211, 'E44D', 'NAM', 'E44A/D occur in patients receiving multiple NRTIs.\r\nE44D and V118I are accessory mutations that usually occur with multiple TAMs.\r\n In this setting they contribute some degree of resistance to each of the NRTIs including 3TC and FTC .'),
(213, 'K65N', 'NAM', 'K65N is a rare mutation that is associated with reduced susceptibility to ddI, ABC, 3TC, FTC and TDF.'),
(219, 'T69D', 'NAM', 'T69D contributes resistance to ddI and d4T.'),
(223, 'K70E', 'NAM', 'K70E reduces TDF, ABC, DDI, and to a lesser extent 3TC and FTC susceptibility. K70E does not reduce AZT or d4T susceptibility.\r\nK70E is selected in patients with virological failure on a TDF containing regimen.\r\n70E usually occurs in viruses lacking TAMs and decreases susceptibility to TDF, ABC, and 3TC .\r\nK70E decreases 3TC  and therefore probably also FTC  susceptibility by about 5-10 fold.'),
(225, 'K70N', 'NAM', 'unknown'),
(226, 'L74I', 'NAM', 'L74I occurs less commonly than L74V mutation and appears to have the same phenotypic and clinical significance .\r\n74I reduces ABC susceptibility x2 fold. \r\nL74I + M184V reduce ABC susceptibility by 5-6 fold with diminished in vivo activity .\r\n74I reduces ddl susceptibility x1.8 fold and is  a predictor of poor virological response to ddl.\r\n74I causes ZDV hypersusceptibility.\r\n74I increases phenotypic susceptibility to TDF .\r\n74I has been associated with decreased TDF clinical activity due to  the presence of other drug-resistance mutations .'),
(227, 'L74V', 'NAM', 'L74V reduces ABC susceptibility x2 fold. \r\nL74V + M184V reduce ABC susceptibility by 5-6 fold with diminished in vivo activity .\r\n74V reduces ddl susceptibility x1.8 fold and is  a predictor of poor virological response to ddl.\r\n74V causes ZDV hypersusceptibility\r\n74V increases phenotypic susceptibility to TDF .\r\n74V has been associated with decreased TDF clinical activity due to  the presence of other drug-resistance mutations .'),
(228, 'V75A', 'NAM', 'V75A reduce d4T and possibly ddI susceptibility.'),
(230, 'V75M', 'NAM', 'V75M occurs in about 2% of patients receiving NRTIs and reduces d4T susceptibility .'),
(232, 'V75T', 'NAM', 'V75T occurs in 1% of patients receiving NRTIs, particularly d4T, and it reduces d4T susceptibility by x2-fold. \r\nV75M occurs in about 2% of patients receiving NRTIs and appears to have the same effect on d4T susceptibility .\r\nV75T reduces d4T and ddI susceptibility.'),
(233, 'F77L', 'NAM', 'F77L increases multinucleoside resistance caused by Q151M when present with V75I or F116Y.Its effect in the absence of Q151M is not known.'),
(234, 'Y115F', 'NAM', 'Y115F causes intermediate resistance to ABC and low-level resistance to TDF.\r\nY115F occurs in about 10%  patients receiving ABC alone and in ~1% of heavily treated patients.\r\nIt reduces ABC susceptibility x3-fold .\r\nBecause ABC is the NRTI that is most affected by Y115F, ABC is unlikely to be a good choice for treating viruses with this mutation. '),
(235, 'F116Y', 'NAM', 'F116Y increases multinucleoside resistance caused by Q151M when present with F77L or V75I.Its effect in the absence of Q151M is not known.\r\nThe combination of Q151M with V75I, F77L, and F116Y reduces 3TC and FTC susceptibility x10-fold.'),
(236, 'V118I', 'NAM', 'V118I occurs in ~2% of untreated persons and with increased frequency in persons receiving multiple NRTIs. It causes low-level resistance to 3TC and possibly to other NRTIs when present with E44A/D and/or one or more TAMs.'),
(237, 'Q151M', 'NAM', 'Q151M confers low-level resistance to TDF, 3TC, and FTC, and high lintermediate-to-high level resistance to each of the remaining NRTIs.\r\n In combination with mutations at positions 75, 77, and 116, Q151M confers intermediate resistance to 3TC, FTC, and TDF, and high-level resistance to the remaining NRTIs.\r\nQ151M alone has little effect on 3TC or FTC susceptibility. However, the combination of Q151M with V75I, F77L, and F116Y reduces 3TC and FTC susceptibility x10-fold.'),
(238, 'M184V', 'NAM', 'M184V causes high-level resistance to FTC , 3TC (>300-fold reduced susceptibility).\r\n In patients with viruses containing M184V,  there is often benefit in continuing FTC because viruses with M184V replicate less well than wild-type viruses and because M184V increases susceptibility to ZDV, d4T, and TDF. \r\nHowever, the benefit of continued FTC in the presence of M184V is less than the benefit of FTC in the presence of wildtype virus.\r\nM184V reduces ddI susceptibility slightly <1.5 fold. \r\n184V + multiple TAMs contribute to greater reductions in susceptibility to ddI.\r\n184V does not appear to reduce the virologic response to ddI.\r\nM184V increase susceptibility to ZDV, TDF, and d4T.\r\n184V increases susceptibility to d4T by an amount that clinically appears to be similar to its effect on ZDV.\r\n184V is not prevented in patients receiving d4T/3TC  but the emergence of M184V slows the development of high-level d4T resistance.\r\nM184V increases phenotypic susceptibility to TDF by x 2 fold and partially restores phenotypic resistance caused by K65R.'),
(239, 'M184I', 'NAM', 'M184VI causes high-level resistance to FTC , 3TC (>300-fold reduced susceptibility).\r\n In patients with viruses containing M184VI,  there is often benefit in continuing FTC because viruses with M184VI replicate less well than wild-type viruses and because M184VI increases susceptibility to ZDV, d4T, and TDF. \r\nHowever, the benefit of continued FTC in the presence of M184VI is less than the benefit of FTC in the presence of wildtype virus.\r\nM184VI reduces ddI susceptibility slightly <1.5 fold. \r\n184VI + multiple TAMs contribute to greater reductions in susceptibility to ddI.\r\n184VI does not appear to reduce the virologic response to ddI.\r\nM184VI increase susceptibility to ZDV, TDF, and d4T.\r\n184VI increases susceptibility to d4T by an amount that clinically appears to be similar to its effect on ZDV.\r\n184VI is not prevented in patients receiving d4T/3TC  but the emergence of M184V slows the development of high-level d4T resistance.\r\nM184VI increases phenotypic susceptibility to TDF by x 2 fold and partially restores phenotypic resistance caused by K65R.\r\n'),
(240, 'T215SCDEIVAN', 'NAM', 'T215S/C/D/E/I/V/A/N represent transitions between wild type and the mutations Y and F. Most of these mutations do not reduce NNRTI susceptibility but their presence suggests that a resistant virus may have been transmitted.'),
(241, 'G333DE', 'NAM', 'May facilitate AZT resistance'),
(1, 'D30N', 'Major PI', 'D30N causes intermediate resistance to NFV.'),
(2, 'V32I', 'Major PI', 'V32I is a substrate cleft mutation that reduces susceptibility to IDV, RTV, FPV, LPV, TPV, and DRV.'),
(9, 'G48M', 'Major PI', 'G48M causes high-level SQV resistance and intermediate resistance to NFV, ATV, IDV, and NFV.'),
(16, 'I54T', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(22, 'V82L', 'Major PI', 'V82L is a rare TPV-selected mutation. Its effect on other PIs has not been characterized.'),
(35, 'L23I', 'Minor PI', 'L23I is a rare substrate cleft mutation that causes low-level resistance to NFV.'),
(39, 'Q58E', 'Minor PI', 'Q58E is a nonpolymorphic mutation that occurs more commonly in treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(60, 'G36D', 'FI', ''),
(74, 'N43S', 'FI', ''),
(96, 'E138K', 'II', ''),
(97, 'G140A', 'II', ''),
(106, 'G163R', 'II', ''),
(154, 'K101HN', 'NNRTI', 'K101H/N are NNRTI-associated mutations with uncertain phenotypic and clinical effects.'),
(160, 'K103S', 'NNRTI', 'K103S causes high-level resistance to NVP and intermediate resistance to DLV and EFV.\r\n'),
(164, 'V106M', 'NNRTI', 'V106M causes high-level resistance to NVP, EFV, and DLV but does not appear to decrease ETV susceptibility.\r\nV106M is associated with >100-fold decreases in EFV susceptibility .\r\nV106M occurs commonly in subtype C viruses in patients receiving NVP and causes high-level NVP resistance .'),
(168, 'V179F', 'NNRTI', 'V179F nearly always occurs in combination with Y181C. \r\nThe combination of V179F + Y181C reduces ETV susceptibility >100-fold and causes low-level EFV resistance.'),
(183, 'M230L', 'NNRTI', 'M230L causes intermediate-to-high-level resistance to each of the NNRTIs. \r\nIt has been selected in vitro by ETV and reduces ETV susceptibility by about 10-fold.'),
(207, 'K219Q', 'TAM', 'Type2 TAM'),
(211, 'E44D', 'NAM', 'E44A/D occur in patients receiving multiple NRTIs.\r\nE44D and V118I are accessory mutations that usually occur with multiple TAMs.\r\n In this setting they contribute some degree of resistance to each of the NRTIs including 3TC and FTC .'),
(212, 'A62V', 'NAM', 'A62V is associated with multinucleoside resistance caused by Q151M.\r\nThe effect of 62V in the absence of Q151M is not known.'),
(219, 'T69D', 'NAM', 'T69D contributes resistance to ddI and d4T.'),
(228, 'V75A', 'NAM', 'V75A reduce d4T and possibly ddI susceptibility.'),
(229, 'V75I', 'NAM', 'V75I increases multinucleoside resistance caused by Q151M when present with F77L and F116Y.\r\nIts effect in the absence of Q151M is not known.\r\n'),
(239, 'M184I', 'NAM', 'M184VI causes high-level resistance to FTC , 3TC (>300-fold reduced susceptibility).\r\n In patients with viruses containing M184VI,  there is often benefit in continuing FTC because viruses with M184VI replicate less well than wild-type viruses and because M184VI increases susceptibility to ZDV, d4T, and TDF. \r\nHowever, the benefit of continued FTC in the presence of M184VI is less than the benefit of FTC in the presence of wildtype virus.\r\nM184VI reduces ddI susceptibility slightly <1.5 fold. \r\n184VI + multiple TAMs contribute to greater reductions in susceptibility to ddI.\r\n184VI does not appear to reduce the virologic response to ddI.\r\nM184VI increase susceptibility to ZDV, TDF, and d4T.\r\n184VI increases susceptibility to d4T by an amount that clinically appears to be similar to its effect on ZDV.\r\n184VI is not prevented in patients receiving d4T/3TC  but the emergence of M184V slows the development of high-level d4T resistance.\r\nM184VI increases phenotypic susceptibility to TDF by x 2 fold and partially restores phenotypic resistance caused by K65R.\r\n'),
(35, 'L23I', 'Minor PI', 'L23I is a rare substrate cleft mutation that causes low-level resistance to NFV.'),
(36, 'L24I', 'Minor PI', 'L24I is associated with reduced susceptibility to IDV and possibly RTV, LPV, SQV, and ATV when present with other mutations.'),
(41, 'A71I', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(43, 'A71V', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(44, 'G73A', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(48, 'T74P', 'Minor PI', 'T74P is a nonpolymorphic mutation that occurs more commonly in heavily treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(60, 'G36D', 'FI', ''),
(61, 'G36E', 'FI', ''),
(62, 'G36S', 'FI', ''),
(68, 'V38G', 'FI', ''),
(71, 'N42T', 'FI', ''),
(74, 'N43S', 'FI', ''),
(91, 'T66I', 'II', ''),
(92, 'L74M', 'II', ''),
(93, 'E92Q', 'II', ''),
(94, 'F121Y', 'II', ''),
(96, 'E138K', 'II', ''),
(98, 'G140S', 'II', ''),
(101, 'Q148R', 'II', ''),
(103, 'S153Y', 'II', ''),
(109, 'Y143H', 'II', ''),
(110, 'D232N', 'II', ''),
(151, 'A98G', 'NNRTI', 'A98G occurs in about 1% of NNRTI-naive persons and causes low-level NVP resistance.\r\n A98S is a common polymorphism that does not reduce NNRTI susceptibility.'),
(154, 'K101HN', 'NNRTI', 'K101H/N are NNRTI-associated mutations with uncertain phenotypic and clinical effects.'),
(163, 'V106I', 'NNRTI', 'V106I is a common polymorphism that does not decrease NNRTI susceptibility. However, in a multivariate analysis it was associated with decreased ETV response in the DUET study.'),
(164, 'V106M', 'NNRTI', 'V106M causes high-level resistance to NVP, EFV, and DLV but does not appear to decrease ETV susceptibility.\r\nV106M is associated with >100-fold decreases in EFV susceptibility .\r\nV106M occurs commonly in subtype C viruses in patients receiving NVP and causes high-level NVP resistance .'),
(165, 'V108I', 'NNRTI', 'V108I causes low-level reductions in susceptibility to each of the NNRTIs except possibly ETV.'),
(167, 'V179E', 'NNRTI', 'V179D/E cause low-level reductions in susceptibility to each of the NNRTIs.\r\n V179D occurs in about 1% of untreated persons. \r\nThe combination of K103R + V179D reduces the susceptibility of NVP, DLV, and EFV by about 15-fold.\r\nThe combination''s effect on ETV is not known.'),
(168, 'V179F', 'NNRTI', 'V179F nearly always occurs in combination with Y181C. \r\nThe combination of V179F + Y181C reduces ETV susceptibility >100-fold and causes low-level EFV resistance.'),
(169, 'Y181C', 'NNRTI', 'Y181C reduces NVP susceptibility >=50-fold.\r\nY181C/I/V cause high-level resistance to NVP and DLV and low-level resistance to EFV. \r\nY181C/I/V reduce EFV susceptibility only x2-fold. \r\nEFV is often ineffective at treating such patients because most patients failing a previous NNRTI-containing regimen harbor virus subpopulations with multiple different NNRTI-resistance mutations.\r\nY181C/I/V reduces ETV susceptibility by 5-10 fold and lays the mutational foundation for the development of higher levels of ETV resistance. \r\nY181C/I/V have consistently been found to produce the greatest (>10 to >20-fold) reductions in ETV susceptibility .\r\nY181C increases susceptibility to AZT and TDF.'),
(171, 'Y181V', 'NNRTI', 'Y181I/V are rare mutations that reduce NVP susceptibility >100-fold.\r\n Y181C/I/V have consistently been found to produce the greatest (>10 to >20-fold) reductions in ETV susceptibility .\r\nEFV is often ineffective at treating such patients because most patients failing a previous NNRTI-containing regimen harbor virus subpopulations with multiple different NNRTI-resistance mutations.'),
(173, 'Y188H', 'NNRTI', 'Y188H causes low-level resistance to NVP, EFV, and DLV and has been selected in vitro by ETV.\r\nY188H/C occur less commonly than Y188L and reduce NVP susceptibility 10-15-fold.\r\n Y188H/C are each associated with about 10-fold decreases in EFV susceptibility .'),
(175, 'G190A', 'NNRTI', 'G190A causes high level resistance to NVP, intermediate resistance to EFV, and low-level ETV resistance.\r\n G190A increases DLV susceptibility.\r\n190A reduces NVP susceptibility by over x50 fold.\r\n190A reduces EFV susceptibility by over x10 fold.\r\n\r\n'),
(182, 'F227L', 'NNRTI', 'F227L usually occurs in combination with V106A and in this setting is associated with high level resistance to NVP and intermediate resistance to DLV and EFV. \r\nIts effect on ETV is not known.'),
(202, 'D67N', 'TAM', 'D67N is a Type2  TAM.\r\nD67N contributes some degree of resistance to each of the NRTIs except 3TC and FTC. \r\nIt usually occurs with mutations at positions 70 or 215.\r\n'),
(206, 'T215Y', 'TAM', 'T215Y  is a Type1 TAM.\r\nT215Y + K70R reduced ZDV susceptibility x10-fold and x4-fold  respectively.\r\n However, combinations of 4 or more TAMs reduced ZDV susceptibility several hundred fold.\r\nThe effect of TAMs on in vitro susceptibility is subtle with two or more TAMs (generally M41L + T215Y) required before reductions (>1.5-fold) in d4T susceptibility are detected. \r\nTAMs are generally considered to be as determinental to the virological success of d4T-containing regimens .\r\n215Y+ M41L + L210W  reduce TDF susceptibility x4 fold and is associated with a marked decrease in TDF activity .\r\nViruses containing only one or two of these three Type1 TAM  retain partial TDF susceptibility .\r\nThe presence of four or more TAMs is usually associated with x5-fold reduced susceptibility to 3TC. \r\nThe clinical significance of this reduction is not known. 215Y +M41L + L210W appear to have the greatest effect on 3TC susceptibility.\r\nTAMs have a subtle effect on in vitro ddI susceptibility, with three or more TAMs (particularly M41L, L210W, and T215Y) required to reduce susceptibility by x1.5 fold.\r\n However, despite the minimal effect on in vitro susceptibility, the presence of M41L, L210W, and T215Y is associated with a greatly reduced virological response to ddI intensification.\r\nT215Y alone has little effect on ABC susceptibility. However, M41L + T215F ? L210W reduces ABC susceptibility 2-3 fold. \r\nThe addition of M184V and other TAMs to this set of mutations reduces ABC susceptibility 6-8 fold and decrease the virologic response to ABC .'),
(212, 'A62V', 'NAM', 'A62V is associated with multinucleoside resistance caused by Q151M.\r\nThe effect of 62V in the absence of Q151M is not known.'),
(214, 'K65N', 'NAM', 'K65N is a rare mutation that is associated with reduced susceptibility to ddI, ABC, 3TC, FTC and TDF.\r\nK65N reduces ABC susceptibility x3 fold. K65N+ M184V reduce  ABC susceptibility x6-8 fold.\r\n65N reduces ddI susceptibility x2 fold. ddI is likely to be inactive at treating patients with viruses containing 65N.\r\n65N reduces FTC , 3TCsusceptibility x15 fold. \r\nThis level of resistance is insufficient to completely interfere with FTC , 3TC activity in vivo because 3TC-escape mutants with K65N nearly always also contain M184V .\r\n65N reduces TDF susceptibility about x2 fold .\r\n65N + M184V is associated with rapid virological failure  in patients receiving TDF/3TC/ABC and TDF/3TC/ddI for initial HAART .\r\n65N occurs less commonly in patients receiving TDF/FTC + NVP or EFV .\r\n65N occurs less commonly with TDF/FTC/EFV than with TDF/3TC/EFV.\r\nK65N rarely occurs in combination with Type I TAMs because of a mutual antagonism among these mutations .'),
(215, 'K65R', 'NAM', 'K65R causes intermediate resistance to ddI, ABC, 3TC, FTC, and TDF, and low-level resistance to d4T. \r\nK65R causes AZT hypersusceptibility.\r\nK65R reduces ABC susceptibility x3 fold. K65R+ M184V reduce  ABC susceptibility x6-8 fold.\r\n65R reduces ddI susceptibility x2 fold. ddI is likely to be inactive at treating patients with viruses containing K65R.\r\n65R reduces FTC , 3TCsusceptibility x15 fold. \r\nThis level of resistance is insufficient to completely interfere with FTC , 3TC activity in vivo because 3TC-escape mutants with K65R nearly always also contain M184V .\r\n65R reduces TDF susceptibility about x2 fold .\r\n65R + M184V is associated with rapid virological failure  in patients receiving TDF/3TC/ABC and TDF/3TC/ddI for initial HAART .\r\n65R occurs less commonly in patients receiving TDF/FTC + NVP or EFV .\r\n65R occurs less commonly with TDF/FTC/EFV than with TDF/3TC/EFV.\r\nK65R rarely occurs in combination with Type I TAMs because of a mutual antagonism among these mutations .\r\n'),
(216, 'D67del', 'NAM', 'Amino acid deletions (d) in this region occur uncommonly and are often assigned to position 67. They occur in combination with other NRTI mutations and contribute decreased susceptibility to each of the NRTIs.'),
(217, 'D67E', 'NAM', 'D67E/G occur in heavily treated patients but their precise effect on NRTI susceptibility is not known.'),
(218, 'D67G', 'NAM', 'D67E/G occur in heavily treated patients but their precise effect on NRTI susceptibility is not known.'),
(220, 'T69del', 'NAM', ''),
(221, 'T69ins', 'NAM', 'T69 insertions occur in  about 1% of treated patients almost always in combination with multiple TAMs.\r\nTogether these mutations cause high-level resistance to each of the NRTIs including 3TC, FTC, and TDF'),
(222, 'T69NSAI', 'NAM', 'unknown'),
(224, 'K70G', 'NAM', 'K70G appears to reduce TDF, ABC, DDI, and to a lesser extent 3TC and FTC susceptibility. K70G does not reduce AZT susceptibility. Its effect on d4T susceptibility is not known.'),
(229, 'V75I', 'NAM', 'V75I increases multinucleoside resistance caused by Q151M when present with F77L and F116Y.\r\nIts effect in the absence of Q151M is not known.\r\n'),
(231, 'V75S', 'NAM', 'V75S may also reduce d4T and ddI susceptibility.'),
(3, 'L33F', 'Major PI', 'L33F are selected by FPV, DRV, LPV, ATV, and TPV, and slightly contribute resistance to these drugs.'),
(4, 'M46I', 'Major PI', 'M46I/L decreases susceptibility to IDV, NFV, FPV, LPV, ATV, TPV, and possibly SQV and DRV when present with other mutations.'),
(5, 'M46L', 'Major PI', 'M46I/L decreases susceptibility to IDV, NFV, FPV, LPV, ATV, TPV, and possibly SQV and DRV when present with other mutations.'),
(6, 'I47V', 'Major PI', 'I47V decrease susceptibility to FPV, ATV, IDV, LPV, TPV, and DRV.'),
(7, 'I47A', 'Major PI', 'I47A usually occurs in combination with V32I and in this setting causes high-level LPV and FPV resistance and probably intermediate DRV resistance.'),
(8, 'G48V', 'Major PI', 'G48V causes high-level SQV resistance, intermediate ATV and NFV resistance, and low-level IDV and LPV resistance.'),
(10, 'I50L', 'Major PI', 'I50L causes intermediate-to-high level resistance to ATV and hypersusceptibility to the remaining PIs.'),
(11, 'I50V', 'Major PI', 'I50V causes intermediate-to-high-level resistance to FPV, intermediate resistance to LPV and DRV, and increased susceptibility to TPV.'),
(12, 'I54A', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(13, 'I54L', 'Major PI', 'I54L occurs in patients receiving FPV, LPV, and DRV and reduces susceptibility to these drugs and to NFV and possibly ATV. It is associated with increased susceptibility to TPV.'),
(14, 'I54M', 'Major PI', 'I54M occurs in patients receiving FPV, LPV, and DRV and reduces susceptibility to these drugs and to ATV and NFV.'),
(15, 'I54S', 'Major PI', 'I54T/A/S are PI-related mutations typically observed in heavily treated persons and like I54V and I54M/L are likely to reduce susceptibility to most PIs.'),
(17, 'I54V', 'Major PI', 'I54V contributes resistance to each of the PIs except possibly DRV when present with other mutations.'),
(18, 'L76V', 'Major PI', 'L76V reduces susceptibility to FPV, IDV, LPV, and DRV and increases susceptibility to SQV and ATV.'),
(20, 'V82A', 'Major PI', 'V82A reduces susceptibility to IDV and LPV. With other mutations it is associated with reduced susceptibility to NFV, ATV, SQV, FPV, and TPV.'),
(21, 'V82F', 'Major PI', 'V82F reduces susceptibility to IDV, LPV, FPV, and DRV. With other mutations it is associated with reduced susceptibility to NFV, ATV, SQV, and TPV.'),
(23, 'V82S', 'Major PI', 'V82S probably has a similar effect to V82T which reduces susceptibility to IDV, LPV, and TPV and with other mutations is associated with reduced susceptibility to NFV, ATV, FPV, and SQV.'),
(24, 'V82T', 'Major PI', 'V82T reduces susceptibility to IDV, LPV, and TPV. With other mutations it is associated with reduced susceptibility to NFV, ATV, FPV, and SQV.'),
(25, 'I84V', 'Major PI', 'I84V causes intermediate/high-level resistance to ATV, FPV, IDV, NFV, SQV, and TPV, and low-level intermediate resistance to LPV and DRV.'),
(26, 'N88S', 'Major PI', 'N88S causes high-level resistance to NFV and ATV and low-level resistance to IDV; it increases susceptibility to FPV.'),
(27, 'N88T', 'Major PI', 'N88T has not been studied but is likely to be similar to N88S which causes high-level resistance to NFV and ATV, low-level resistance to IDV, and increased susceptibility to FPV.'),
(28, 'N88G', 'Major PI', 'N88G has not been studied but is likely to be similar to N88S which causes high-level resistance to NFV and ATV, low-level resistance to IDV, and increased susceptibility to FPV.'),
(29, 'L90M', 'Major PI', 'L90M causes resistance to NFV, SQV, ATV, and IDV. When present with other mutations it also compromises the activity of FPV, LPV, and TPV. Its effect on DRV is not known.'),
(31, 'L10F', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(32, 'L10I', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(33, 'L10V', 'Minor PI', 'L10I/V/F/R are associated with resistance to each of the PIs when present with other mutations. L10I/V occur commonly in 5-10% of untreated persons. L10FRY are nonpolymorphic.'),
(34, 'V11I', 'Minor PI', 'V11I is a nonpolymorphic accessory mutation weakly associated with PI therapy. It is one of the 11 mutations associated with decreased response to DRV in the POWER trials.'),
(36, 'L24I', 'Minor PI', 'L24I is associated with reduced susceptibility to IDV and possibly RTV, LPV, SQV, and ATV when present with other mutations.'),
(37, 'K43T', 'Minor PI', 'K43T is a nonpolymorphic mutation that is significantly more common in viruses from PI-treated compared with untreated persons. It was weakly associated with a decreased virological response to TPV in the RESIST trials.'),
(38, 'F53L', 'Minor PI', 'F53L occurs only in isolates from treated patients nearly always in combinations with other PI-resistance mutations. It is associated with decreased susceptibility to IDV, LPV, and SQV and possibly other PIs. F53Y is a rare treatment-associated variant.'),
(41, 'A71I', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(42, 'A71T', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(43, 'A71V', 'Minor PI', 'A71T/V are polymorphisms that occur in 1-2% of untreated persons but which become much more frequent in persons receiving PIs. A71I is an uncommon mutation that appears to occur only with PI therapy; its significance is not known.'),
(44, 'G73A', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(45, 'G73C', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(46, 'G73S', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(47, 'G73T', 'Minor PI', 'G73S/T/C/A are selected by and appear to be associated with decreased susceptibility to most, if not all, PIs.'),
(48, 'T74P', 'Minor PI', 'T74P is a nonpolymorphic mutation that occurs more commonly in heavily treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(49, 'N83D', 'Minor PI', 'N83D is a nonpolymorphic mutation that occurs more commonly in heavily treated patients. It has been associated with decreased virological response to TPV but probably is associated with resistance to multiple PIs.'),
(50, 'L89V', 'Minor PI', 'L89V is an uncommon nonpolymorphic PI-selected accessory mutation. It is one of the 11 mutations associated with decreased response to DRV in the POWER trials.'),
